// PetNames.js
import React from 'react';

function PetNames() {
  return (
    <div>
      <h2>Nombres para Mascotas</h2>
      <p>Encuentra el nombre perfecto para tu nueva mascota en nuestra lista de nombres populares.</p>
    </div>
  );
}

export default PetNames;
